import{_ as e,o as t,c as a,O as o}from"./chunks/framework.9482e208.js";const f=JSON.parse('{"title":"§ 55.1-1603 Certain covenants of lessee that \\"he will not assign without leave\\" and that \\"he will leave the premises in good repair.\\".","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/55.1-1603.md","filePath":"vacode/55.1-1603.md"}'),s={name:"vacode/55.1-1603.md"},i=o('<h1 id="§-55-1-1603-certain-covenants-of-lessee-that-he-will-not-assign-without-leave-and-that-he-will-leave-the-premises-in-good-repair" tabindex="-1">§ 55.1-1603 Certain covenants of lessee that &quot;he will not assign without leave&quot; and that &quot;he will leave the premises in good repair.&quot;. <a class="header-anchor" href="#§-55-1-1603-certain-covenants-of-lessee-that-he-will-not-assign-without-leave-and-that-he-will-leave-the-premises-in-good-repair" aria-label="Permalink to &quot;§ 55.1-1603 Certain covenants of lessee that &quot;he will not assign without leave&quot; and that &quot;he will leave the premises in good repair.&quot;.&quot;">​</a></h1><p>In a lease, (i) a covenant by the lessee that &quot;he will not assign without leave&quot; shall have the same effect as a covenant that the lessee will not, during the term, assign, transfer, or set over the premises, or any part of such premises, to any person without the consent, in writing, of the lessor or the lessor&#39;s representative or assigns, and (ii) a covenant by the lessee that &quot;he will leave the premises in good repair&quot; shall, subject to the qualifications of § <a href="/vacode/55.1-1411/">55.1-1411</a>, have the same effect as a covenant that the demised premises will, at the expiration or other sooner determination of the term, be peaceably surrendered and yielded to the lessor or the lessor&#39;s representatives or assigns in good and substantial repair and condition, reasonable wear and tear excepted.</p><p>Code 1919, § 5179; Code 1950, § 55-77; 2019, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?191+ful+CHAP0011" target="_blank" rel="noreferrer">11</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?191+ful+CHAP0049" target="_blank" rel="noreferrer">49</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?191+ful+CHAP0712" target="_blank" rel="noreferrer">712</a>.</p>',3),n=[i];function r(l,h,c,d,p,v){return t(),a("div",null,n)}const g=e(s,[["render",r]]);export{f as __pageData,g as default};
